import React, { useEffect, useState } from 'react';
import {  Link } from "react-router-dom";
const Doggie = () => {
    const url = "https://api.thedogapi.com/v1/images/search?limit=16";
    const [data, setData] = useState();
    useEffect((seq) => {
        fetch(url + '&order=' + seq).then((response) => response.json()).then((resJson) => { setData(resJson);console.log(resJson); })
            .catch((err) => console.log('error'))
    }, [])
    return (
        <>
            <div className="App">
            {
                data.map((index,i) => (
                    <Link to={'/detail'} state={{ data: index }}  key={i}  >  <img className="card-img" src={index.url} alt='images' /></Link>
                ))
            }
            </div>
        </>
    );
}

export default Doggie;
